  \"Oceanographic profile data collected from CTD and sound velocimeter - moving vessel
  profiler casts aboard FA2805, FA2806, FA2808 and FAIRWEATHER as part of project
  OPR-P183-FA-15 in the Gulf of Alaska and North Pacific Ocean from 2015-05-16 to
  2015-06-14 (NCEI Accession 0130665)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:17:25.987750\",\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-and-sound-velocimeter-moving-vessel-profiler-9757a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130665 includes physical
  and profile data collected aboard the FA2805, FA2806, FA2808 and FAIRWEATHER during
  project OPR-P183-FA-15 in the Gulf of Alaska and North Pacific Ocean from 2015-05-16
  to 2015-06-14. These data include CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY,
  SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and sound velocimeter - moving vessel profiler. These data
  were collected and submitted by the NOAA Office of Coast Survey in support of hydrographic
  multibeam surveys to meet NOAA charting requirements.\",\n\t\"license_title\": \"License
